import { Typography,Grid,FormControlLabel,TextField,Checkbox,LinearProgress, Link, makeStyles, CssBaseline, AppBar, Toolbar, Paper, Stepper, Step, StepLabel, Button } from '@material-ui/core';
import React from 'react';
import theme from '../theme';
import {ThemeProvider} from '@material-ui/core';


interface OtpProps {
    changeState:(newstate:number)=>void;
}

function Copyright() {
    return (
      <Typography variant="body2" color="textSecondary" align="center">
        {'Copyright © '}
        <Link color="inherit" href="https://material-ui.com/">
          Your Website
        </Link>{' '}
        {new Date().getFullYear()}
        {'.'}
      </Typography>
    );
  }

  const useStyles = makeStyles((theme) => ({
    appBar: {
      position: 'relative',
      width:'100vw'
    },
    TextField: {

      width:'5vw'
    },
    layout: {
      width: 'auto',
      marginLeft: theme.spacing(2),
      marginRight: theme.spacing(2),
      [theme.breakpoints.up(600 + theme.spacing(2) * 2)]: {
        width: 600,
        marginLeft: 'auto',
        marginRight: 'auto',
      },
    },
    paper: {
      marginTop: theme.spacing(3),
      marginBottom: theme.spacing(3),
      padding: theme.spacing(2),
      [theme.breakpoints.up(600 + theme.spacing(3) * 2)]: {
        marginTop: theme.spacing(6),
        marginBottom: theme.spacing(6),
        padding: theme.spacing(3),
        width:'50vw',
        height:'40vw',
        marginLeft: 'auto',
        marginRight: 'auto',

      },
    },
    stepper: {
      padding: theme.spacing(3, 0, 5),
    },
    buttons: {
      display: 'flex',
      justifyContent: 'flex-end',
      width:'5vw',
    },
    button: {
      marginTop: theme.spacing(3),
      marginLeft: theme.spacing(1),
      width:'5vw',
    },
  }));



const Otp: React.FC<OtpProps> = ({changeState }: OtpProps) => {
    const classes = useStyles();

    return(
      <ThemeProvider theme={theme}>
        <React.Fragment>
      <CssBaseline />
      <AppBar position="absolute" color="default" className={classes.appBar}>
      <Toolbar>
        <Grid container justify="flex-end" style={{ padding: 0 }}>
        <Button
              type="submit"
              variant="outlined"
              style={{backgroundColor: '#fff', color: '#000'}}
              onClick={()=>changeState(2)}
            >
              Sign Out
            </Button>
        </Grid>

        </Toolbar>
      </AppBar>

        <Paper className={classes.paper}>
          Business Setup....................................................03/04
        <LinearProgress variant="determinate" value={75} />

        <Typography variant="h6" color="inherit" noWrap>
            Your Business Details.
          </Typography>
          We're here for you no matter how big or small. What's your business size?
          <br></br>
          <FormControlLabel
        control={
          <Checkbox
            name="checkedB"
            color="primary"
          />
        }
        label="Primary"
      />
      <FormControlLabel
        control={
          <Checkbox
            name="checkedB"
            color="primary"
          />
        }
        label="Primary"
      />
      <FormControlLabel
        control={
          <Checkbox
            name="checkedB"
            color="primary"
          />
        }
        label="Primary"
      />
      <br></br>
      <TextField id="outlined-basic" label="Custom Amount" variant="outlined" />
      <br></br>
      Got an exact figure? Please share.
      <br></br>
      What is your average basket size?
      <br></br>
      <TextField id="outlined-basic" label="Basket Size" placeholder="Basket Size e.g. R12000" variant="outlined" />
      <br></br>
      This is the average amount your consumer spends at checkout.
      <br></br>
          <React.Fragment>
          <Button
              type="submit"
              variant="outlined"
              style={{backgroundColor: '#fff', color: '#000'}}
              onClick={()=>changeState(2)}
            >
              Skip Step
            </Button>
            <Button
              type="submit"
              variant="contained"
              color="primary"
              onClick={()=>changeState(2)}
            >
              Continue
            </Button>
          </React.Fragment>
        </Paper>
        <Copyright />

    </React.Fragment>
    </ThemeProvider>
    );
}


export default Otp;
